import {Route, Switch} from 'react-router-dom';
import Widget6 from './Widget6';
import {BrowserRouter} from 'react-router-dom';

import Admin from './admin';


import './App.css';

class App extends Component {
  render() {
    return (

      <div>

        <BrowserRouter>

          <Route path = "/admin" exact component = {Admin}/>

        </BrowserRouter>




        <Widget />
        <Widget2 />
        <Widget3 />
        <Widget4 />
        <Widget5 />
        <Widget6 />

      </div>

    );
  }
}

export default App;
